DROP TABLE IF EXISTS `order_detail`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `order_detail` (
  `no` int NOT NULL AUTO_INCREMENT,
  `order_no` int NOT NULL,
  `user_no` int NOT NULL,
  `seller_no` int NOT NULL,
  `product_no` int NOT NULL,
  `product_name` varchar(255) NOT NULL,
  `product_price` int NOT NULL,
  `discount` int NOT NULL,
  `company` varchar(255) NOT NULL,
  `brand` varchar(255) NOT NULL,
  `quantity` int NOT NULL,
  `delivery_no` int DEFAULT NULL,
  `order_date` date NOT NULL COMMENT '작성 가능 리뷰를 불러올 때 주문과 join을 줄이기 위해 추가',
  `delivery_status` int NOT NULL DEFAULT '0' COMMENT '배송 준비(0)\n배송 시작(1)\n배송 완료(2)',
  `cancle_status` int NOT NULL DEFAULT '0',
  `refound_status` int NOT NULL DEFAULT '0',
  `reason` text,
  `settlement_no` int DEFAULT NULL,
  `purchase_confirmation_date` date DEFAULT NULL,
  `settlement_status` int DEFAULT '0',
  PRIMARY KEY (`no`),
  KEY `FK_order_main_TO_order_detail_1` (`order_no`),
  KEY `FK_delivery_TO_order_detail_1` (`delivery_no`),
  CONSTRAINT `FK_delivery_TO_order_detail_1` FOREIGN KEY (`delivery_no`) REFERENCES `delivery` (`no`),
  CONSTRAINT `FK_order_main_TO_order_detail_1` FOREIGN KEY (`order_no`) REFERENCES `order_main` (`no`)
) ENGINE=InnoDB AUTO_INCREMENT=707 DEFAULT CHARSET=utf8mb3;
